      SELECT DISTINCT 62 * - - 94 AS col2 FROM tab2 (FORMAT parquet) WHERE ( NULL ) NOT BETWEEN col0 + + col0 - + col0 AND - col0 * 58 * + col0 + + - 65 * - 43;
  - name: tab2

outputs:
  - name: q1621.out
    data: |
